<div id='get' style='display:none;'>{{Language}}</div>
<script>
	var langs = ['Bulgarian','Czech','Danish','Estonian','Finnish','Greek','Hungarian','Latvian','Lithuanian','Romanian','Slovak','Slovenian','Swedish','French','German','Spanish', 'Dutch', 'Italian', 'Polish', 'Portuguese', 'Russian'];
	for (i = 0; i < langs.length; i++) {
