			document.getElementById('deepl').style.display = "";
			document.getElementById('deepl2').style.display = "";
			document.getElementById('deepl3').style.display = "";
		}
	}
</script>

<script>
	var langs = ['French','German','Spanish', 'Dutch', 'Italian', 'Polish', 'Portuguese', 'Russian', 'Arabic', 'Hebrew', 'Japanese', 'Turkish', 'Chinese'];
	for (i = 0; i < langs.length; i++) {
		if(document.getElementById('get').innerHTML.indexOf(langs[i]) !== -1) {
			document.getElementById('rev').style.display = "";
		}
	}
</script>
<!------------------------------------------------>

<script>
   function show(id) {
     document.getElementById(id).style.display = "";
     document.getElementById('button').style.visibility = "hidden";
   }
